		super(props);

		this.state = {
			user: {}
		};
	}

	render() {

		let defaultPage;
		if (this.state.user.id) {
			defaultPage = <h1>Default</h1>; // <Main />;
		}
		else {
			defaultPage = <h1>Main</h1> // <Login />;
		}

		return (
			{defaultPage}
			);

	}

}

export default App;
